//import 'materialize-css/dist/css/materialize.min.css';
import { HashLink as Link } from 'react-router-hash-link';

import './menu.scss';

export default function Menu(props) {


	return (
		<div className='menu'>

<Link to='#about'>
				<div className="navLink"> About</div>
			</Link>
			<Link to='#project'>
				<div className="navLink"> Work</div>
			</Link>


		</div>
	);

}
